import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';

function Ranking() {
  return (
    <Container maxWidth="sm" sx={{ position: 'relative' }}>
      <Typography
        variant="h4"
        align="center"
        color="primary"
        m={4}
      >
        Le classement
      </Typography>
    </Container>
  );
}

export default Ranking;
